INSERT INTO `values` (`id`, `parent_id`, `code`, `name`, `units`, `description`, `color`) VALUES
(1, NULL, NULL, 'Land', NULL, 'Vegetation and Land Cover, Land Use, Food Supply and Caloric Intake, Agricultural Production, Environmental Hazards, Climate, Protected Areas and Environmental Protection', NULL),
(23, 1, NULL, 'Land Use', NULL, 'Agricultural Area, Agricultural Area Actually Irrigated, Agricultural Area Certified Organic, Arable Land, Arable Land and Permanent Crops, Average Carbon Content in the Topsoil, Country Area, Forest Area, Land Area, Percentage of Arable Land Equipped for Irrigation, Permanent Crops, Permanent Meadows and Pastures, Total Area Equipped for Irrigation, Wood Fuel Production', NULL),
(24, 23, '1672', 'Agricultural Area', '1000 Hectares', 'Agricultural area, this category is the sum of areas under a) arable land - land under temporary agricultural crops (multiple-cropped areas are counted only once), temporary meadows for mowing or pasture, land under market and kitchen gardens and land temporarily fallow (less than five years). The abandoned land resulting from shifting cultivation is not included in this category. Data for Arable land are not meant to indicate the amount of land that is potentially cultivable; (b) permanent crops - land cultivated with long-term crops which do not have to be replanted for several years (such as cocoa and coffee); land under trees and shrubs producing flowers, such as roses and jasmine; and nurseries (except those for forest trees, which should be classified under \"forest\"); and (c) permanent meadows and pastures - land used permanently (five years or more) to grow herbaceous forage crops, either cultivated or growing wild (wild prairie or grazing land).', '#f92638'),
(25, 23, '2134', 'Agricultural Area Actually Irrigated', '1000 Hectares', 'Agricultural area irrigated, part of the full or partial control irrigated Agricultural land which is actually irrigated in a given year. Often, part of the equipped area is not irrigated for various reasons, such as lack of water, absence of farmers, land degradation, damage, organisational problems etc.Starting from 2001, the land-use questionnaire was revised in order to obtain further information on the land-use sub-categories as well as areas that are actually irrigated.', '#e8fe0f'),
(27, 23, '686', 'Arable Land', '1000 Hectares', 'Arable Land: land under temporary crops (double-cropped areas are counted only once), temporary meadows for mowing or pasture, land under market and kitchen gardens and land temporarily fallow (less than five years). The abandoned land resulting from shifting cultivation is not included in this category. Data for \"Arable land\" are not meant to indicate the amount of land that is potentially cultivable.', '#af897a'),
(31, 23, '2136', 'Forest Area', '1000 Hectares', 'Forest area is the land spanning more than 0.5 hectares with trees higher than 5 metres and a canopy cover of more than 10 percent, or trees able to reach these thresholds in situ. It does not include land that is predominantly under agricultural or urban land use. Forest is determined both by the presence of trees and the absence of other predominant land uses. The trees should be able to reach a minimum height of 5 metres (m) in situ. Areas under reforestation that have not yet reached but are expected to reach a canopy cover of 10 percent and a tree height of 5 m are included, as are temporarily unstocked areas, resulting from human intervention or natural causes, which are expected to regenerate. Includes: areas with bamboo and palms provided that height and canopy cover criteria are met; forest roads, firebreaks and other small open areas; forest in national parks, nature reserves and other protected areas such as those of specific scientific, historical, cultural or spiritual interest; windbreaks, shelterbelts and corridors of trees with an area of more than 0.5 ha and width of more than 20 m; plantations primarily used for forestry or protective purposes, such as: rubber-wood plantations and cork, oak stands. Excludes: tree stands in agricultural production systems, for example in fruit plantations and agroforestry systems. The term also excludes trees in urban parks and gardens.', '#6921d5'),
(32, 23, '1685', 'Land Area', '1000 Hectares', 'Land area is the total area of the country excluding area under inland water bodies. Possible variations in the data may be due to updating and revisions of the country data and not necessarily to any change of area.', '#b81cf2'),
(34, 23, '691', 'Permanent Crops', '1000 Hectares', 'Permanent Crops: Land cultivated with crops that occupy the land for long periods and need not be replanted after each harvest, such as cocoa, coffee and rubber; this category includes land under flowering shrubs, fruit trees, nut trees and vines, but excludes land under trees grown for wood or timber.', '#02c347'),
(38, 1, NULL, 'Food Supply and Caloric Intake', NULL, 'Average Supply of Protein of Animal Origin, Average Value of Food Production, Food Supply Quantity - Cereals, Food Supply Quantity - Fish and Seafood, Food Supply Quantity - Meat', NULL),
(39, 38, '3044', 'Average Supply of Protein of Animal Origin', 'Gram/Capita/Day', 'Dietary protein consumption per person refers to the amount of protein in food, expressed in grams per day, available for each individual in the total population during the reference period. Protein content is derived by applying the appropriate food composition factors to the quantities of the commodities. Per person consumption is derived from the total amount of food available for human consumption by dividing total protein by total population actually partaking of the food supplies during the reference period. However, per person figures represent only the average supply available for the population as a whole and do not necessarily indicate what is actually consumed by individuals. The actual food consumption may be lower than the quantity shown as food availability depending on the magnitude of wastage and losses of food in the household, e.g. during storage, in preparation and cooking, as plate-waste or quantities fed to domestic animals and pets, thrown or given away.', '#43f47d'),
(40, 38, '3045', 'Average Value of Food Production', 'I$ per Person', 'For primary commodities, production relates to the total domestic production whether inside or outside the agricultural sector, i.e. including non-commercial production and production in kitchen gardens. Unless otherwise indicated, production is reported at the farm level for primary crops (i.e. excluding harvesting losses for crops) and livestock items and in terms of live weight (i.e. the actual ex-water weight of the catch at the time of capture) for primary fish items. Production of processed commodities relates to the total output of the commodity at the manufacture level (i.e. it comprises output from domestic and imported raw materials of originating products). Reporting units are chosen accordingly, e.g. cereals are reported in terms of grains and paddy rice. As a general rule, all data on meat are expressed in terms of carcass weight. Usually the data on production relate to that which takes place during the reference period. However, production of certain crops may relate to the harvest of the year preceding the utilization period if harvesting takes place late in the year. In such instances, the production of a given year largely moves into consumption in the subsequent year. In the Food Balance Sheets a distinction is made between \"output\" and \"input\". The production of primary as well as of derived products is reported under \"output\". For derived commodities, the amounts of the originating commodity that are required for obtaining the output of the derived product are indicated under \"input\", and are expressed in terms of the originating commodity. The various factors used, i.e. milling rates, extraction rates, conversion or processing factors, carcass weights, milk yield, egg weights etc., should indicate the average national rate at which these commodities are generally converted.', '#4efdeb'),
(41, 38, '2206', 'Food Supply Quantity - Cereals', 'Tonnes', 'Refers to the total amount of food available for human consumption expressed in Tonnes.', '#f1b4d3'),
(42, 38, '2204', 'Food Supply Quantity - Fish and Seafood', 'Tonnes', 'Refers to the total amount of food available for human consumption expressed in Tonnes.', '#ff2a60'),
(43, 38, '2205', 'Food Supply Quantity - Meat', 'Tonnes', 'Refers to the total amount of food available for human consumption expressed in Tonnes.', '#796e7b'),
(67, 1, NULL, 'Environmental Hazards', NULL, 'Forest Fire Extent, Slides - Killed People', NULL),
(68, 67, '960', 'Forest Fire Extent', 'Thousand Hectares', 'Forest Fire Extent - Annual Average comprises the reported forest areas exposed to fire.Total Forest includes natural forests and forest plantations. The term is used to refer to land with a tree cover of more than 10 percent and area of more than 0.5 ha. Forests are determined both by the presence of trees and the absence of other predominant land uses. The trees should be able to reach a minimum height of 5 m. Young stands that have not yet reached, but are expected to reach, a crown density of 10m percent and tree height of 5 m are included under forest, as are temporarily unstocked areas. The term includes forests used for purposes of production, protection, multiple use or conservation (i.e. forest in national parks, nature reserves and other protected areas), as well as forest stands on agricultural lands (e.g. windbreaks and shelterbelts of trees with a width of more than 20 m) and rubberwood plantations and cork oak stands. The term specifically excludes stands of trees established primarily for agricultural production, for example fruit tree plantations. It also excludes trees planted in agroforestry systems.', '#f51d2f'),
(69, 67, '558', 'Slides - Killed People', 'Number of People', 'Killed: Persons confirmed as dead and persons missing and presumed dead.Disaster: Situation or event, which overwhelms local capacity, necessitating a request to national or international level for external assistance; An unforeseen and often sudden event that causes great damage, destruction and human suffering. Though often caused by nature, disasters can have human origins. Wars and civil disturbances that destroy homelands and displace people are included among the causes of disasters. Other causes can be: building collapse, blizzard, drought, epidemic, earthquake, explosion, fire, flood, hazardous material or transportation incident (such as a chemical spill), hurricane, nuclear incident, tornado, or volcano.Slide: Disaster type comprising the two disaster subsets \"avalanche\" (Rapid and sudden sliding and flowage of masses of usually unsorted mixtures of snow/ice/rock material) and \"landslide\" (In general, all varieties of slope movement, under the influence of gravity. More strictly refers to down-slope movement of rock and/or earth masses along one or several slide surfaces).', '#200221'),
(70, 1, NULL, 'Climate', NULL, 'Land Area where Elevation is Below 5 meters - Percent of Land Area', NULL),
(71, 70, '2323', 'Land Area where Elevation is Below 5 meters - Percent of Land Area', 'Percent of Land Area', 'Land area below 5m is the percentage of total land where the elevation is 5 meters or less.', '#b06722'),
(72, 1, NULL, 'Protected Areas and Environmental Protection', NULL, 'Protected Areas (Marine, IUCN Categories I-VI and not Classified) - Percent of Marine Area, Protected Areas (Marine, IUCN Categories I-VI and not Classified) - Total, Protected Areas (Terrestrial and Marine Combined, IUCN Categories I-VI and not Classified) - Percent of Total Territorial Area, Protected Areas (Terrestrial and Marine Combined, IUCN Categories I-VI and not Classified) - Total, Protected Areas (Terrestrial, IUCN Categories I-VI and not Classified) - Percent of Terrestrial Area, Protected Areas (Terrestrial, IUCN Categories I-VI and not Classified) - Total, Wetlands of International Importance (Ramsar Sites) - Area, Wetlands of International Importance (Ramsar Sites) - Number', NULL),
(73, 72, '1876', 'Protected Areas (Marine, IUCN Categories I-VI and not Classified) - Percent of Marine Area', 'Percent', 'A marine protected area is an area of sea especially dedicated to the protection and maintenance of biodiversity, and of natural and associated cultural resources, and managed through legal or other effective means.Marine parks, nature reserves and other marine protected areas can include: reefs, seagrass beds, shipwrecks, archaeological sites, tidal lagoons, mudflats, saltmarshes, mangroves, rock platforms, underwater areas on the coast and seabed in deep water.Some of the Benefits of Marine Protected Areas:- maintaining biodiversity - protecting endangered or threatened species such as whales, marine turtles and seagrass meadows and their habitats - enhancing fisheries by ensuring breeding areas are not degraded and catch limits are sustainable - providing opportunities for research - conserving our cultural heritage, such as sites of Aboriginal significanceA protected area is defined by The World Conservation Union (IUCN) as:An area of land and/or sea especially dedicated to the protection and maintenance of biological diversity, and of natural and associated cultural resources, and managed through legal or other effective meansAlthough all protected areas meet the general purposes contained in this definition, in practice the precise purposes for which protected areas are managed differ greatlyFollowing are the definitions of IUCN Management categories I-VI. Category Ia. Strict Nature Reserve: protected area managed mainly for science. Area of land and/or sea possessing some outstanding or representative ecosystems, geological or physiological featuresand/or species, available primarily for scientific research and/or environmental monitoring. Category Ib. Wilderness Area: protected area managed mainly for wilderness protection.Large area of unmodified or slightly modified land, and/or sea, retaining its natural character and influence, without permanent or significant habitation, which is protected and managed so as to preserve its natural condition. Category II.  National Park: protected area managed mainly for ecosystem protection and recreation. Natural area of land and/or sea, designated to a) protect the ecological integrity of one or more ecosystems for present and future generations; b) exclude exploitation or occupation inimical to the purposes of designation of the area and c) provide a foundation for spiritual, scientific, educational, recreational and visitor opportunities, all of which must be environmentally and culturally compatible.Category III. Natural Monument: protected area managed mainly for conservation of specific natural features. Area containing one, or more, specific natural or natural/cultural feature which is of outstanding or unique value because of its inherent rarity, representative or aesthetic qualities or cultural significance.Category IV.  Habitat/Species Management Area: protected area managed mainly for conservation through management intervention. Area of land and/or sea subject to active intervention for management purposes so as to ensure the maintenance of habitats and/or to meet the requirements of specific species.Category V.  Protected Landscape/Seascape: protected area managed mainly for landscape/seascape conservation and recreation. Area of land, with coast and sea as appropriate, where the interaction of people and nature over time has produced an area of distinct character with significant aesthetic, ecological and/or cultural value, and often with high biological diversity. Safeguarding the integrity of this traditional interaction is vital to the protection, maintenance and evolution of such an area.Category VI.  Managed Resource Protected Area: protected area managed mainly for the sustainable use of natural ecosystems. Area containing predominantly unmodified natural systems, managed to ensure long term protection and maintenance of biological diversity, while providing at the same time a sustainable flow of natural products and services to meet community needs.For more information on the variables and collection methodologies see original source or the IUCN Web site: http://wcpa.iucn.org/', '#59f6c5'),
