(82, 81, NULL, 'Economy', NULL, 'Agriculture Value Added - Percent of GDP, Aid Donors:  Rio Conventions Objectives - Biodiversity, Aid Donors:  Rio Conventions Objectives - Climate Change Adaptation, Aid Donors:  Rio Conventions Objectives - Climate Change Mitigation, Aid Donors:  Rio Conventions Objectives - Desertification, Aid Recipients:  Rio Conventions Objectives - Biodiversity, Aid Recipients:  Rio Conventions Objectives - Climate Change Mitigation, Aid Recipients:  Rio Conventions Objectives - Desertification, Alternative Conversion Factor (Exchange Rate), Cash Surplus/Deficit - Percent of of GDP, Central Government Debt - Percent of GDP, Charges for the Use of Intellectual Property - Payments, Charges for the Use of Intellectual Property - Receipts, Consumer Price Index (2000 = 100), Economically Active Population, External Debt Stocks - Total, Foreign Direct Investment - Net Inflows, General Government Final Consumption Expenditure, Gini Index, Gross Domestic Product, Gross Domestic Product - Annual Percentage Growth Rate, Gross Domestic Product - Purchasing Power Parity, Gross National Income, Industry Value Added, Manufacturing Value Added, Military Expenditures - Percent of GDP, Net ODA Received - per Capita, Net Official Aid Received, Official Development Assistance and Official Aid, Patent Applications - non Residents, Patent Applications - Residents, Percentage of Population Below US $ 1.25 per Day Consumption, Percentage of Population Below US $ 2 per Day Consumption, Poverty Gap at US $ 1.25 (PPP), Poverty Gap at US $ 2 (PPP), Research and Development Expenditure - percent of GDP, Services Value Added - Percent of GDP, Total Unemployment - Percent of Total Labor Force', NULL),
(86, 82, '3008', 'Aid Donors:  Rio Conventions Objectives - Climate Change Mitigation', 'Million US$', 'Biodiversity-related aid is defined as activities that promote at least one of the three objectives of the Convention: the conservation of biodiversity, sustainable use of its components (ecosystems, species or genetic resources), or fair and equitable sharing of the benefits of the utilisation of genetic resources. Full definition.Desertification-related aid is defined as activities that combat desertification or mitigate the effects of drought in arid, semi arid and dry sub-humid areas through prevention and/or reduction of land degradation, rehabilitation of partly degraded land, or reclamation of desertified land. Full definition.Climate change mitigation-related aid is defined as activities that contribute to the objective of stabilisation of greenhouse gas (GHG) concentrations in the atmosphere at a level that would prevent dangerous anthropogenic interference with the climate system by promoting efforts to reduce or limit GHG emissions or to enhance GHG sequestration.  Full definition.Climate change adaptation-related aid. In December 2009 the DAC members approved a new marker to also track aid in support of climate change adaptation. This new marker will complement the existing climate change mitigation marker, and thus allow presentation of a more complete picture of aid in support of developing countries\' efforts to address climate change.  climate change adaptation .', '#aa9a95'),
(121, 81, NULL, 'Transport', NULL, 'Air Transport - Passengers Carried, Railways Lines - Total Route-km, Railways Traffic - Goods Hauled, Railways Traffic - Passenger Carried', NULL),
(122, 121, '2165', 'Air Transport - Passengers Carried', 'People', 'Air passengers carried include both domestic and international aircraft passengers of air carriers registered in the country. Source: International Civil Aviation Organization, Civil Aviation Statistics of the World and ICAO staff estimates.', '#a091a1'),
(123, 121, '2166', 'Railways Lines - Total Route-km', 'Kilometers', 'Rail lines are the length of railway route available for train service, irrespective of the number of parallel tracks. Source: World Bank, Transportation, Water, and Urban Development Department, Transport Division.', '#d76034'),
(124, 121, '1801', 'Railways Traffic - Goods Hauled', 'Million Tons-Km', 'Goods transported by railway are the volume of goods transported by railway, measured in metric tons times kilometers traveled. Source: World Bank, Transportation, Water, and Urban Development Department, Transport Division.', '#2cf6c0'),
(125, 121, '1511', 'Railways Traffic - Passenger Carried', 'Million Passengers-Km', 'Passengers carried by railway are the number of passengers transported by rail times kilometers traveled. Source: World Bank, Transportation, Water, and Urban Development Department, Transport Division.', '#3bb730'),
(126, 81, NULL, 'Waste Production and Management', NULL, 'Amounts of Municipal Waste - Total, Municipal Waste Collection, Participation in Treaties - Basel Convention, Participation in Treaties - Rotterdam Convention, Waste Recycling Rates - Glass, Waste Recycling Rates - Paper and Cardboard', NULL),
(127, 126, '1534', 'Amounts of Municipal Waste - Total', 'Thousand Tons', 'Waste collected and treated by or for municipalities. It covers waste from households, including bulky waste, similar waste from commerce and trade, office buildings, institutions and small businesses, yard and garden waste, street sweepings, the contents of litter containers, and market cleansing waste. The definition excludes waste from municipal sewage networks and treatment, as well as municipal construction and demolition waste', '#e7bdbe'),
(128, 126, '2239', 'Municipal Waste Collection', 'Thousand Tons', 'Municipal waste includes waste originating from: households, commerce and trade, small businesses, office buildings and institutions (schools, hospitals, government buildings).  It also includes bulky waste (e.g. white goods, old furniture, mattresses) and waste  from selected municipal services, e.g. waste from park and garden maintenance, waste from street cleaning services (street sweepings, the content of litter containers, market cleansing waste), if managed as waste.  The definition excludes waste from municipal sewage network and treatment, municipal construction and demolition waste.Municipal waste collected refers to waste collected by or on behalf of municipalities, as well as municipal waste collected by the private sector. It includes mixed waste, and fractions collected separately for recovery operations (through door-to-door collection  and/or through voluntary deposits). Percentage of total population served by municipal waste collection refers to the percentage proportion of the total population covered by regular municipal waste removal service in relation to the total population of the country.', '#8a8808'),
(129, 126, '1477', 'Participation in Treaties - Basel Convention', 'Number of Parties Subscribing each Year', 'The Basel Convention on the Control of Tranboundary Movements of Hazardous Wastes and their Disposal was adopted in 1989 and entered into force on 5 May 1992.', '#3152d7'),
(130, 126, '1580', 'Participation in Treaties - Rotterdam Convention', 'Number of Parties Subscribing each Year', 'The Convention establishes the principle that export of a chemical covered by the Convention can only take place with the prior informed consent of the importing party.  The Convention establishes a \"Prior Informed Consent procedure,\" a means for formally obtaining and disseminating the decisions of importing countries as to whether they wish to receive future shipments of specified chemicals and for ensuring compliance with these decisions by exporting countries.The Convention initially covers 22 pesticides (including five severely hazardous pesticide formulations) and 5 industrial chemicals, but many more are expected to be added in the future.  The Conference of the Parties will decide on the inclusion of chemicals.', '#3d9374'),
(131, 126, '1552', 'Waste Recycling Rates - Glass', 'Percent of Apparent Consumption', 'Recycling is defined as reuse of material in a production process that diverts it from the waste stream, except for recycling within industrial plants and the reuse of material as fuel.\"Recycling rates\" are the ratios of the quantity collected for recycling to the apparent consumption (economic notion of domestic production of the respective material + imports - exports).It should, however, be noted that definitions may vary from one country to another. In particular, total amounts of waste produced, rather than apparent consumption, may be used in some areas to derive recycling rates.', '#bb5ce5'),
(132, 126, '1551', 'Waste Recycling Rates - Paper and Cardboard', 'Percent of Apparent Consumption', 'Recycling is defined as reuse of material in a production process that diverts it from the waste stream, except for recycling within industrial plants and the reuse of material as fuel.\"Recycling rates\" are the ratios of the quantity collected for recycling to the apparent consumption (economic notion of domestic production of the respective material + imports - exports).It should, however, be noted that definitions may vary from one country to another. In particular, total amounts of waste produced, rather than apparent consumption, may be used in some areas to derive recycling rates.', '#7d1390'),
