(148, 146, '3041', 'Economically Active Population in Agriculture', 'Thousand People', 'Economically active population in agriculture (agricultural labour force) is that part of the economically active population engaged in or seeking work in agriculture, hunting, fishing or forestry.', '#7e2473'),
(165, 146, '1810', 'Population - Total both Sexes', 'Thousand People', 'Population: de facto population in a country, area or region as of 1 July of the year indicated.', '#842e33'),
(166, 146, '9', 'Population - Total Female', 'Thousand People', 'De facto population as of 1 July of the year indicated classified by sex.', '#88576d'),
(167, 146, '699', 'Population - Total Male', 'Thousand People', 'De facto population as of 1 July of the year indicated classified by sex.', '#350244'),
(209, 81, NULL, 'Energy Consumption and Production', NULL, 'Electricity Consumption - Residential (IEA), Electricity Consumption - Transport Sector (IEA), Electricity - Distribution Losses (IEA), Electricity - Domestic Supply (IEA), Electricity - Nuclear Industry (IEA), Electricity - Production (IEA), Electricity - Total Final Consumption (IEA), Energy Consumption for Road Transport Sector - Total (IEA), Energy Consumption for Total Transport Sector - Total (IEA), Energy Production - Biodiesel (IEA), Energy Production - Biogasoline (IEA), Energy Production - Combustible Renewables and Waste (IEA), Energy Production - Crude Oil (IEA), Energy Production - Hydro (IEA), Energy Production - Natural gas (IEA), Energy Production - Nuclear (IEA), Energy Production - Other Liquid Biofuels (IEA), Energy Production - Total (IEA), Nuclear Power Reactors Operable - Electrical Output, Nuclear Power Reactors Operable - Number, Nuclear Power Reactors Planned - Electrical Output, Nuclear Power Reactors Planned - Number, Nuclear Power Reactors Proposed - Electrical Output, Nuclear Power Reactors Proposed - Number, Nuclear Power Reactors Under Construction - Electrical Output, Nuclear Power Reactors Under Construction - Number, Total Final Energy Consumption - Biodiesel (IEA), Total Final Energy Consumption - Biogasoline (IEA), Total Final Energy Consumption - Other Liquid Biofuels (IEA), Total Final Energy Consumption - Total (IEA), Total Primary Energy Supply - Coal and Coal Products (IEA), Total Primary Energy Supply - Combustible Renewables and Waste (IEA), Total Primary Energy Supply - Crude Oil (IEA), Total Primary Energy Supply - Geothermal (IEA), Total Primary Energy Supply - Hydro (IEA), Total Primary Energy Supply - Natural Gas (IEA), Total Primary Energy Supply - Nuclear (IEA), Total Primary Energy Supply - Petroleum Products (IEA), Total Primary Energy Supply - Solar, Wind, Tide and Other (IEA), Total Primary Energy Supply - Total (IEA)', NULL),
(219, 209, '2039', 'Energy Production - Biodiesel (IEA)', 'Thousand Tons of Oil Equivalent (KTOE)', 'Biodiesels includes biodiesel (a methyl-ester produced from vegetable or animal oil, of diesel quality), biodimethylether (dimethylether produced from biomass), Fischer Tropsh (Fischer Tropsh produced from biomass), cold pressed bio-oil (oil produced from oil seed through mechanical processing only) and all other liquid biofuels which are added to, blended with or used straight as transport diesel. Biodiesels includes the amounts that are blended into the diesel - it does not include the total volume of diesel into which the biodiesel is blended.A KTOE is defined as 41.868 TJ (Terajoules) or 11.630 GWh (Gigawatt-Hour).', '#3e7343');
INSERT INTO `values` (`id`, `parent_id`, `code`, `name`, `units`, `description`, `color`) VALUES
(222, 209, '1741', 'Energy Production - Crude Oil (IEA)', 'Thousand Tons of Oil Equivalent (KTOE)', 'Energy production comprises crude oil, natural gas liquids, refinery feedstocks, and additives as well as other hydrocarbons such as synthetic oil, mineral oils extracted from bituminous minerals (in the row production) and oils from coal and natural gas liquefaction (in the row liquefaction). Production is calculated after removal of impurities (e.g. sulphur from natural gas).A TOE is defined as 41.868 gigajoules or 10 Exp 7 kilocalories.  One terawatt-hour = 0.086 MTOE.', '#f25c16'),
(224, 209, '1744', 'Energy Production - Natural gas (IEA)', 'Thousand Tons of Oil Equivalent (KTOE)', 'Gas includes natural gas (excluding natural gas liquids) and gas works gas. The latter appears as a positive figure in the \"gas works\" row but is not part of production.A TOE is defined as 41.868 gigajoules or 10 Exp 7 kilocalories.  One terawatt-hour = 0.086 MTOE.', '#6ee73b'),
(249, 209, '767', 'Total Primary Energy Supply - Total (IEA)', 'Thousand Tons of Oil Equivalent (KTOE)', 'Total primary energy supply (TPES) is made up of indigenous production + imports - exports - international marine bunkers +/- stock changes.Indigenous production is the production of primary energy, i.e. hard coal, lignite, peat, crude oil, NGLs, natural gas, combustible enewables and waste, nuclear, hydro, geothermal, solar and the heat from heat pumps that is extracted from the ambient environment. Production is calculated after removal of impurities.A TOE is defined as 41.868 gigajoules or 10 Exp 7 kilocalories.  One terawatt-hour = 0.086 MTOE.', '#408afc'),
(250, 81, NULL, 'Trade Balances', NULL, 'Exports of Goods and Services, Imports of Goods and Services, Trade - Percent of GDP', NULL),
(251, 250, '614', 'Exports of Goods and Services', 'Million Constant 2005 US$', 'Exports of goods and services represent the value of all goods and other market services provided to the rest of the world. They include the value of merchandise, freight, insurance, transport, travel, royalties, license fees, and other services, such as communication, construction, financial, information, business, personal, and government services. They exclude labor and property income (formerly called factor services) as well as transfer payments. Data are in constant 2000 U.S. dollars. Source: World Bank national accounts data, and OECD National Accounts data files.', '#f7852b'),
(252, 250, '619', 'Imports of Goods and Services', 'Million Constant 2005 US$', 'Imports of goods and services represent the value of all goods and other market services received from the rest of the world. They include the value of merchandise, freight, insurance, transport, travel, royalties, license fees, and other services, such as communication, construction, financial, information, business, personal, and government services. They exclude labor and property income (formerly called factor services) as well as transfer payments. Data are in constant 2000 U.S. dollars. Source: World Bank national accounts data, and OECD National Accounts data files.', '#fa1834'),
(253, 250, '620', 'Trade - Percent of GDP', 'Percent', 'Trade is the sum of exports and imports of goods and services measured as a share of gross domestic product. Source: World Bank national accounts data, and OECD National Accounts data files.', '#16b3ac'),
(254, 81, NULL, 'Rivers and Lakes', NULL, 'Fish Catch - Inland Waters', NULL),
(255, 254, '938', 'Fish Catch - Inland Waters', 'Metric Tons', 'Data relate to nominal catch of fish, crustaceans and mollusks*, taken for commercial, industrial, recreational and subsistence purposes. The harvest from mariculture, aquaculture and other kinds of fish farming is excluded.Data include all quantities caught and landed for both food and feed purposes but exclude discards. Catches of fish, crustaceans and molluscs are expressed in live weight, that is the nominal weight of the aquatic organisms at the time of capture.To assign nationality to catches, the flag of the fishing vessel is used, unless the wording of chartering and joint operation contracts indicates otherwise.* includes all FAOSTAT group excepted aquatic animals nei, aquatic plants, aquatic mammals', '#92e0b6'),
(256, 81, NULL, 'Education', NULL, 'Girls to Boys Ratio in Primary Education Enrolment, Gross Enrolment Ratio in Primary Education, Gross Enrolment Ratio in Secondary Education, Gross Enrolment Ratio in Tertiary Education, Net Enrolment Ratios in Primary Education, Net Enrolment Ratios in Secondary Education, Population of the Official Age for Primary Education, Population of the Official Age for Secondary Education, Population of the Official Age for Tertiary Education, Ratio of Literate Women to Men Aged 15-24, Teachers in Primary Education, Teachers in Secondary Education, Teachers in Tertiary Education, Total Number of Graduates in Tertiary Education', NULL),
(262, 256, '1130', 'Net Enrolment Ratios in Secondary Education', 'Percent', 'Enrolment of the official age group for a given level of education expressed as a percentage of thecorresponding population.', '#4c6a84'),
(270, 256, '2154', 'Total Number of Graduates in Tertiary Education', 'Number of People', 'The total number of graduated in tertiary education; including all programmes.', '#4d10d8'),
(271, 81, NULL, 'Private Consumption', NULL, 'Household Final Consumption Expenditure - Total', NULL),
(272, 271, '633', 'Household Final Consumption Expenditure - Total', 'Million Constant 2005 US$', 'Household final consumption expenditure (formerly private consumption) is the market value of all goods and services, including durable products (such as cars, washing machines, and home computers), purchased by households. It excludes purchases of dwellings but includes imputed rent for owner-occupied dwellings. It also includes payments and fees to governments to obtain permits and licenses. Here, household consumption expenditure includes the expenditures of nonprofit institutions serving households, even when reported separately by the country. Data are in constant 2000 U.S. dollars. Source: World Bank national accounts data, and OECD National Accounts data files.', '#e26da0'),
(273, 81, NULL, 'Tourism', NULL, 'International Tourism - Arrivals, International Tourism - Departures', NULL),
(274, 273, '1138', 'International Tourism - Arrivals', 'People', 'International inbound tourists (overnight visitors) are the number of tourists who travel to a country other than that in which they have their usual residence, but outside their usual environment, for a period not exceeding 12 months and whose main purpose in visiting is other than an activity remunerated from within the country visited. When data on number of tourists are not available, the number of visitors, which includes tourists, same-day visitors, cruise passengers, and crew members, is shown instead. Source: World Tourism Organization, Yearbook of Tourism Statistics, Compendium of Tourism Statistics and data files.', '#5c93fc'),
(275, 273, '1141', 'International Tourism - Departures', 'People', 'International outbound tourists are the number of departures that people make from their country of usual residence to any other country for any purpose other than a remunerated activity in the country visited. Source: World Tourism Organization, Yearbook of Tourism Statistics, Compendium of Tourism Statistics and data files.', '#393add'),
(276, 81, NULL, 'Protected Areas and Environmental Protection', NULL, 'ISO 14001 Certifications, Participation in Treaties - Convention on Biological Diversity, Participation in Treaties - Ramsar Convention on Wetlands, Participation in Treaties - World Heritage Convention, World Heritage Sites - Number', NULL),
(277, 276, '1777', 'ISO 14001 Certifications', 'Number of Certifications', 'The ISO 14000 family is primarily concerned with \"environmental management\". This means what the organization does to:- minimize harmful effects on the environment caused by its activities, and to- achieve continual improvement of its environmental performance.The vast majority of ISO standards are highly specific to a particular product, material, or process. However, the standards that have earned the ISO 9000 and ISO 14000 families a worldwide reputation are known as \"generic management system standards\".', '#f30803'),
(278, 276, '1488', 'Participation in Treaties - Convention on Biological Diversity', 'Number of Parties Subscribing each Year', 'The Convention on Biological Diversity promotes conservation of biodiversity among nations through scientific and technological cooperation, access to financial and genetic resources, and transfer of ecologically sound technologies.', '#531d3a'),
(279, 276, '1575', 'Participation in Treaties - Ramsar Convention on Wetlands', 'Number of Parties Subscribing each Year', 'The Convention on Wetlands, signed in Ramsar, Iran, in 1971, is an intergovernmental treaty which provides the framework for national action and international cooperation for the conservation and wise use of wetlands and their resources. There are presently 138 Contracting Parties to the Convention, with 1317 wetland sites, totaling 111 million hectares, designated for inclusion in the Ramsar List of Wetlands of International Importance.', '#fd217c'),
(280, 276, '1576', 'Participation in Treaties - World Heritage Convention', 'Number of Parties Subscribing each Year', 'According to the World Heritage Convention, \"cultural heritage\" is a monument, group of buildings or site of historical, aesthetic, archaeological, scientific, ethnological or anthropological value. \"Natural heritage\" designates outstanding physical, biological, and geological features; habitats of threatened plants or animal species and areas of value on scientific or aesthetic grounds or from the point of view of conservation.', '#03ae80'),
(281, 276, '38', 'World Heritage Sites - Number', 'Number of Sites', 'According to the World Heritage Convention, \"cultural heritage\" is a monument, group of buildings or site of historical, aesthetic, archaeological, scientific, ethnological or anthropological value. \"Natural heritage\" designates outstanding physical, biological, and geological features; habitats of threatened plants or animal species and areas of value on scientific or aesthetic grounds or from the point of view of conservation.', '#366a19'),
(282, 81, NULL, 'Total and Threatened Species', NULL, 'Participation in Treaties - Convention on International Trade in Endangered Species of Wild Fauna and Flora, Participation in Treaties - Convention on the Conservation of Migratory Species of Wild Animals', NULL),
(283, 282, '1578', 'Participation in Treaties - Convention on International Trade in Endangered Species of Wild Fauna and Flora', 'Number of Parties Subscribing each Year', 'CITES (the Convention on International Trade in Endangered Species of Wild Fauna and Flora)  works by subjecting international trade in specimens of selected species to certain controls. These require that all import, export, re-export and introduction from the sea of species covered by the Convention has to be authorized through a licensing system. (\'Re-export\' means export of a specimen that was imported.)', '#649244'),
(284, 282, '1577', 'Participation in Treaties - Convention on the Conservation of Migratory Species of Wild Animals', 'Number of Parties Subscribing each Year', 'CMS has a unique role to play in focusing attention on and addressing the conservation needs of the 107 endangered species presently listed in Appendix I - including, among others, the Siberian crane, White-tailed eagle, Hawksbill turtle, Mediterranean monk seal and Dama gazelle. Appendix II lists migratory species that require or would benefit significantly from international co-operative Agreements under CMS. These may range from legally-binding treaties to less formal memoranda of understanding. The more formal Agreements should provide for co-ordinated species conservation and management plans; conservation and restoration of habitat; control of factors impeding migration; co-operative research and monitoring; and public education and exchange of information among Parties.', '#5a7af6'),
(285, 81, NULL, 'Emissions of GHG, ODS, Dust, Metals', NULL, 'Participation in Treaties - Kyoto Protocol, Participation in Treaties - United Nations Framework Convention on Climate Change, Participation in Treaties - Vienna Convention and Montreal Protocol', NULL),
(286, 285, '1478', 'Participation in Treaties - Kyoto Protocol', 'Number of Parties Subscribing each Year', 'Building on the framework of the Convention, the Kyoto Protocol broke new ground with its legally-binding constraints on greenhouse gas emissions and its innovative \"mechanisms\" aimed at cutting the cost of curbing emissions.', '#72a99e'),
(287, 285, '1479', 'Participation in Treaties - United Nations Framework Convention on Climate Change', 'Number of Parties Subscribing each Year', 'The ultimate objective of the UN Framework Convention on Climate Change is \"to achieve stabilization of atmospheric concentrations of greenhouse gases at levels that would prevent dangerous anthropogenic (human-induced) interference with the climate system\".', '#76834f'),
(288, 285, '1487', 'Participation in Treaties - Vienna Convention and Montreal Protocol', 'Number of Parties Subscribing each Year', 'Through  The Vienna Convention on the Protection of the Ozone Layer governments committed themselves to protect the ozone layer and to co-operate with each other in scientific research to improve understanding of the atmospheric processes.The Montreal Protocol on Substances that Deplete the Ozone Layer was adopted by Governments in 1987 and has been modified five times so far. Its control provisions were strengthened through four adjustments to the Protocol adopted in London (1990), Copenhagen (1992), Vienna (1995), Montreal (1997) and Beijing (1999). The Protocol aims to reduce and eventually eliminate the emissions of man-made ozone depleting substances', '#9ff6dd'),
(289, 81, NULL, 'Fertilizer and Pesticides Consumption and Production', NULL, 'Participation in Treaties - Stockholm Convention on Persistent Organic Pollutants', NULL),
(290, 289, '1573', 'Participation in Treaties - Stockholm Convention on Persistent Organic Pollutants', 'Number of Parties Subscribing each Year', 'Persistent Organic Pollutants (POPs) are chemical substances that persist in the environment, bioaccumulate through the food web, and pose a risk of causing adverse effects to human health and the environment. With the evidence of long-range transport of these substances to regions where they have never been used or produced and the consequent threats they pose to the environment of the whole globe, the international community has now, at several occasions called for urgent global actions to reduce and eliminate releases of these chemicals.The chemicals slated for elimination under the Stockholm Convention are the pesticides aldrin, chlordane, dieldrin, endrin, heptachlor, hexachlorobenzene (HCB), mirex and toxaphene, as well as the industrial chemical polychlorinated biphenyls (PCBs).  Continued use of the pesticide DDT is allowed for disease vector control until safe, affordable and effective alternatives are in place.  Countries must make determined efforts to indentify label and remove PCB-containing equipment from use by 2025.  The Convention also seeks the continuing minimization and, where feasible, elimination of the releases of unintentionally produced POPs such as the industrial byproducts dioxins and furans.', '#3b9fa0'),
(291, 81, NULL, 'Vegetation and Land Cover', NULL, 'Participation in Treaties - United Nations Convention to Combat Desertification', NULL),
(292, 291, '1574', 'Participation in Treaties - United Nations Convention to Combat Desertification', 'Number of Parties Subscribing each Year', 'In 1992, the United Nations Conference on Environment and Development (UNCED) or so called Rio Earth Summit remmended the elaboration of a United Nations Convention to Combat Desertification (UNCCD). The Convention, the only convention stemming from a direct recommendation of the Conference\'s Agenda 21, was adopted in Paris on 17 June 1994 and entered into force in December 1996. It is the first and only internationally legally binding framework set up to address the problem of desertification. The Convention is based on the principles of participation, partnership and decentralization - the backbone of Good Governance. It now has more than 180 country Parties to the Convention, making it truly global in reach.', '#d9984e'),
(293, 81, NULL, 'Human Settlements', NULL, 'Refugee Population by Country of Asylum, Refugee Population by Country of Origin', NULL),
(294, 293, '1923', 'Refugee Population by Country of Asylum', 'Thousand People', 'The following country notes serve primarily to explain changes in the population, which are not due to new arrivals or returns.This set reflects the official sources for refugee statistics. Considering that only few industrialized countries maintain a refugee register,UNHCR has estimated the refugee population in a number of countries, based on recent refugee arrivals and recognition of asylum-seekers.The data are generally provided by governments, based on their own definitions and methods data collections.Due to these differences in sources, definition and methods, Part C of the Annex provides a more solid basis for comparing theasylum and refugee experience between industrialized countries.', '#6490b1'),
(295, 293, '1925', 'Refugee Population by Country of Origin', 'Thousand People', 'The following country notes serve primarily to explain changes in the population, which are not due to new arrivals or returns.This set reflects the official sources for refugee statistics. Considering that only few industrialized countries maintain a refugee register,UNHCR has estimated the refugee population in a number of countries, based on recent refugee arrivals and recognition of asylum-seekers.The data are generally provided by governments, based on their own definitions and methods data collections.Due to these differences in sources, definition and methods, Part C of the Annex provides a more solid basis for comparing theasylum and refugee experience between industrialized countries.', '#ab701d'),
(296, 81, NULL, 'Urbanisation', NULL, 'Rural Population - Total, Urban Population - Average Annual Growth Rate, Urban Population - Percent of Total Population, Urban Population - Total', NULL),
(297, 296, '2180', 'Rural Population - Total', 'Thousand People', 'Total population residing in rural areas.Because of national differences in the characteristics that distinguish urban from rural areas, the distinction between urban and rural population is not amenable to a single definition that would be applicable to all countries. National definitions are most commonly based on size of locality. Population which is not urban is considered rural.', '#1d250b'),
(298, 296, '826', 'Urban Population - Average Annual Growth Rate', 'Percent', 'The average annual rate of change of population living in defined urban areas during a specified period.Because of national differences in the characteristics that distinguish urban from rural areas, the distinction between urban and rural population is not amenable to a single definition that would be applicable to all countries. National definitions are most commonly based on size of locality. Population which is not urban is considered rural.', '#a277f4'),
(299, 296, '340', 'Urban Population - Percent of Total Population', 'Percent', 'Percentage of total population residing in urban areas.Because of national differences in the characteristics that distinguish urban from rural areas, the distinction between urban and rural population is not amenable to a single definition that would be applicable to all countries. National definitions are most commonly based on size of locality. Population which is not urban is considered rural.The annual series of the percentage of the urban population have been derived through interpolation of the quinquennial series prepared by the UN (World Urbanization Prospects: The 2005 Revision).', '#1e9e7a'),
(300, 296, '341', 'Urban Population - Total', 'Thousand People', 'Total population residing in urban areas.Because of national differences in the characteristics that distinguish urban from rural areas, the distinction between urban and rural population is not amenable to a single definition that would be applicable to all countries. National definitions are most commonly based on size of locality. Population which is not urban is considered rural.The annual series of the urban population was obtained by systematically applying to the total population the percentage of urban population. The annual series of the percentage of the urban population have been derived through interpolation of the quinquennial series prepared by the UN (World Urbanization Prospects: The 2005 Revision).', '#8ba52b'),
(301, NULL, NULL, 'Water', NULL, 'Water Consumption and Resources, Boundaries, Vegetation and Land Cover, Population', NULL),
(340, 301, NULL, 'Boundaries', NULL, 'Claimed Exclusive Economic Zone (EEZ), Continental Shelf Area, Exclusive Fishing Zone (EFZ), Length of Coastline, Territorial Sea', NULL),
(341, 340, '279', 'Claimed Exclusive Economic Zone (EEZ)', 'Square Kilometers', 'The United Nations Convention on the Law of the Sea (UNCLOS) is an international agreement that sets conditions and limits on the use and exploitation of the oceans. This Convention also sets the rules for the maritime jurisdictional boundaries of the different member states. The UNCLOS was opened for signature on 10 December 1982 in Montego Bay, Jamaica, and it entered into force on 16 November 1994. As of January 2000, there are 132 countries that have ratified UNCLOS. Under UNCLOS, coastal States can claim sovereign rights in a 200-nautical mile exclusive economic zone (EEZ). This allows for sovereign rights over the EEZ in terms of exploration, exploitation, conservation and management of all natural resources in the seabed, its subsoil and overlaying waters. UNCLOS allows other states to navigate and fly over the EEZ, as well as to lay submarine cables and pipelines. The inner limit of the EEZ starts at the outer boundary of the Territorial Sea (i.e., 12 nautical miles from the low-water line along the coast).In cases where a country\'s low-water lines is within 400 nautical miles of each other the EEZ boundaries are generally established by treaty, though there are many cases where these are in dispute.Under UNCLOS, \"land-locked and geographically disadvantaged States have the right to participate on an equitable basis in exploitation of an appropriate part of the surplus of the living resources of the EEZ\'s of coastal States of the same region or sub-region.\" Some States have not ratified UNCLOS and many have not yet claimed their EEZ. These areas of unclaimed EEZ are the areas that a State has the right to claim under UNCLOS, but has not done so yet.Given the uncertainties surrounding much of the delimitation of the EEZ, these figures should be used with cautionFurther information on the Web site: http://www.maritimeboundaries.com/', '#50d8c5'),
(342, 340, '1085', 'Continental Shelf Area', 'Square Kilometers', 'According to the UN Convention of the Law of the Sea, the Continental Shelf is the area of the seabed and subsoil which extends beyond the territorial sea to a distance of 200 nautical miles from the territorial sea baseline and beyond that distance to the outer edge of the continental margin. Areas of continental shelf that are disputed by overlaping claims by one or more nations have been excluded from this table. Areas that are of cooperative joint development between two or more nations have also been excluded. Coastal States have sovereign rights over the continental shelf (the national area of the seabed) for exploring and exploiting it; the shelf can extend at least 200 nautical miles from the shore, and more under specified circumstances. The United Nations Convention on the Law of the Sea (UNCLOS) is an international agreement that sets conditions and limits on the use and exploitation of the oceans. This Convention also sets the rules on how the maritime jurisdictional boundaries of the different member states are set. The UNCLOS was opened for signature on 10 December 1982 in Montego Bay, Jamaica, and it entered into force on 16 November 1994. As of January 2000, there are 132 countries that have ratified UNCLOS.Further information on the Web site: http://www.maritimeboundaries.com/', '#6fc103'),
(343, 340, '278', 'Exclusive Fishing Zone (EFZ)', 'Square Kilometers', 'The exclusive fishing zone or fishery zone refers to an area beyond the outer limit of the territorial sea (12 nautical miles from the coast) in which the coastal State has the right to fish, subject to any concessions which may be granted to foreign fishermen. Some countries have made no claim beyond the territorial sea. Some States have claimed an exclusive fishing zone instead of the more encompassing 200 nautical mile Exclusive Economic Zone (EEZ). The United Nations Convention on the Law of the Sea (UNCLOS) is an international agreement that sets conditions and limits on the use and exploitation of the oceans. This Convention also sets the rules for the maritime jurisdictional boundaries of the different member states. The UNCLOS was opened for signature on 10 December 1982 in Montego Bay, Jamaica, and it entered into force on 16 November 1994. As of January 2000, there are 132 countries that have ratified UNCLOS. Under UNCLOS, coastal States can claim sovereign rights in a 200-nautical mile exclusive economic zone (EEZ). This allows for sovereign rights over the EEZ in terms of exploration, exploitation, conservation and management of all natural resources in the seabed, its subsoil, and overlaying waters. UNCLOS allows other states to navigate and fly over the EEZ, as well as to lay submarine cables and pipelines. The inner limit of the EEZ starts at the outer boundary of the Territorial Sea (i.e., 12 nautical miles from the low-water line along the coast). Some States have not ratified UNCLOS and many have not yet claimed their EEZ. Given the uncertainties surrounding much of the delimitation of the fishing zones, these figures should be used with caution. Further information on the Web site: http://www.maritimeboundaries.com/', '#30f685'),
(344, 340, '1088', 'Length of Coastline', 'Kilometers', 'The measurement of an irregular and curving feature such as a nation\'s coastal length is scale-dependent and very difficult to measure. Maps of individual islands for example, frequently show great detail, whereas regional maps summarize complex coastlines into a few simple lines. In addition, coastal features are constantly changing due to erosion, etc. The only way to derive comparable statistics on coastline length is to use a single source which uses a constant scale. This is what has been attempted with the data presented in this table, however, highly complex coastlines will appear longer at higher resolutions. Estimates may differ from other published sources. Because of the difficulty in trying to measure coastline length, these figures should be interpreted as approximations and should be used with caution. Coastline length was derived from the World Vector Shoreline database at 1:250,000 kilometers. The estimates presented here were calculated using a Geographic Information System (GIS) and an underlying database consistent for the entire world. The methodology used to estimate length is based on the following: 1) A country\'s coastline is made up of individual lines, and an individual line has two or more vertices and/or nodes. 2) The length between two vertices is calculated on the surface of a sphere. 3) The sum of the lengths of the pairs of vertices is aggregated for each individual line, and 4) the sum of the lengths of individual lines was aggregated for a country. In general, the coastline length of islands that are part of a country, but are not overseas territories, are included in the coastline estimate for that country (i.e., Canary Islands are included in Spain). Coastline length for overseas territories and dependencies are listed separately. Disputed areas are not included in country or regional totals.', '#519cdb'),
(345, 340, '277', 'Territorial Sea', 'Square Kilometers', 'Territorial sea is defined under the United Nations Convention on the Law of the Sea (UNCLOS) as the 12-nautical mile zone from the baseline or low-water line along the coast. The coastal State\'s sovereignty extends to the territorial sea, including its sea-bed, subsoil, and air space above it. Foreign vessels are allowed \"innocent passage\" through those waters. Even though the established limit for a territorial sea is 12 nautical miles, some countries claim larger areas. Territorial seas with overlapping claims from different countries are shown separately as disputed territorial seas. UNCLOS is an international agreement that sets conditions and limits on the use and exploitation of the oceans. This Convention also sets the rules for the maritime jurisdictional boundaries of the different member states. The UNCLOS was opened for signature on 10 December 1982 in Montego Bay, Jamaica, and it entered into force on 16 November 1994. As of January 2000, there are 132 countries that have ratified UNCLOS. Given the uncertainties surrounding much of the delimitation of the territorial seas, these figures . should be used with caution.Further information on the Web site: http://www.maritimeboundaries.com/', '#56fd99'),
(346, 301, NULL, 'Vegetation and Land Cover', NULL, 'Mangroves Forest Extent - Total Area', NULL),
(347, 346, '1253', 'Mangroves Forest Extent - Total Area', 'Thousand Hectares', 'Mangroves are commonly found along sheltered coastlines in the tropics and subtropics where they fulfil important socio-economic and environmental functions. These include the provision of a large variety of wood and non-wood forest products; coastal protection againstthe effects of wind, waves and water currents; conservation of biological diversity, including a number of endangered mammals, reptiles, amphibians and birds; protection of coral reefs, sea-grass beds and shipping lanes against siltation; and provision of habitat, spawning grounds and nutrients for a variety of fish and shellfish, including many commercial species.Mangrove trees and shrubs, including ferns and palms, are found along river banks and coastlines in tropical and subtropical countries. Their main characteristic is that they can tolerate salt and brackish water environments. Globally, there are seventy known species of mangroves.', '#56c57e'),
(348, 301, NULL, 'Population', NULL, 'Population Within 100 Kilometers of Coast', NULL),
(349, 348, '280', 'Population Within 100 Kilometers of Coast', 'People', 'Estimates were based on 1975-2007 population figures recalulated on the base of Landscan 2007 poulation. The Landscan population (Oak Ridge National Laboratory) is a raster data set that provides information on the spatial distribution of the world\'s human \"ambient\" population. Populations are distributed according to administrative districts which vary in scale, level and size from country to country. A 100 km coastal buffer were used in the geographic information system to calculate the number of people in the coastal zone for each country individually.', '#3fc698'),
(350, NULL, NULL, 'All GEO Themes', NULL, 'Food Supply and Caloric Intake', NULL),
(351, 350, NULL, 'Food Supply and Caloric Intake', NULL, 'Cereal Import Dependency Ratio', NULL),
(352, 351, '3046', 'Cereal Import Dependency Ratio', 'Percent', 'Import dependency ratio (IDR) is defined as: IDR = imports*100/(production + imports - exports). The complement of this ratio to 100 would represent that part of the domestic food supply that has been produced in the country itself. However, there is a caveat to be kept in mind: these ratios hold only if imports are mainly used for domestic utilization and are not re-exported.', '#c0418b'),
(353, NULL, NULL, 'Chemichals & Waste', NULL, 'Emissions of GHG, ODS, Dust, Metals, Health, Fertilizer and Pesticides Consumption and Production', NULL),
(367, 353, NULL, 'Health', NULL, 'Diseases of the Respiratory System - Number of Deaths, Hospital Beds - per 10 000 Population, Number of Physicians, Nursing and Midwifery Personnel Density - per 10 000 Population', NULL),
(368, 367, '418', 'Diseases of the Respiratory System - Number of Deaths', 'Number of People', 'Diseases of the Respiratory System: Effects are generally irritation and reduced lung function with increased incidence of respiratory disease, especially in more susceptible members of the population such as young children, the elderly and asthmatics.Diseases of the Respiratory System includes: ICD-9 BTL codes B31-B32,ICD-9 code CH08 for some ex-USSR countries,ICD-9 code C052 for China,ICD-10 codes J00-J99, European mortality indicator database (HFA-MDB), available at www.euro.who.int, for missing figures for some european countries:indicator \"3250 Deaths, Diseases of the Respiratory System\"', '#108cc7'),
(369, 367, '2160', 'Hospital Beds - per 10 000 Population', 'Number of beds per 10,000 People', 'Number of hospital beds per 10 000 persons', '#b1810e'),
(370, 367, '2158', 'Number of Physicians', 'Number of People', 'Number of medical doctors (physicians), including generalist and specialist', '#6c7661'),
(371, 367, '2159', 'Nursing and Midwifery Personnel Density - per 10 000 Population', 'Personnel per  10,000 People', 'The World Health Organization Mortality Data base comprises deaths registered in national vital registration systems, with underlying cause of death as coded by the relevant national authority. The method of estimation for number of nursing and midwifery personnel', '#c6ba78'),
