(427, 394, '1198', 'Emissions of GHGs - Total (CO2, CH4, N2O, HFCs, PFCs and SF6) (National Reports, UNFCCC), Including Land Use, Land-Use Change and Forestry', 'Gigagrams CO2 Equivalent', 'Emissions of Total GHG (CO2, CH4, N2O, HFCs, PFCs and SF6) (UNFCCC), Excluding Land-Use Change and Forestry The Global Warming Potential (GWP) is an index used to translate the level of emissions of various gases into a common measure in order to compare the relative radiative forcing of different gases without directly calculating the changes in atmospheric concentrations. GWPs are calculated as the ratio of the radiative forcing that would result from the emissions of one kilogram of a greenhouse gas to that from the emission of one kilogram of carbon dioxide over a period of time (usually 100 years). Gases involved in complex atmospheric chemical processes have not been assigned GWPs.', '#98ccc4'),
(428, 394, '2254', 'Emissions of HFCs  - all Gases', 'Gigagrams  GWP‐100', 'Hydrofluorocarbons (HFCs) are excellent alternatives for use in refrigerators and industrial air conditioners.But while they do not deplete stratospheric ozone, they are extremely powerful greenhouse gases with a high globalwarming potential. Globally, HFC emissions are currently growing at a rate of 8 per cent per year. The use ofHFCs could potentially wipe out all the climate benefits gained through phasing out CFCs and other ozone-depleting substances.', '#32c4af'),
(434, 394, '1977', 'Emissions of N2O (National Reports, UNFCCC), Including Land Use, Land-Use Change and Forestry', 'Gigagrams CO2 Equivalent', 'Emissions of N2O with LULUCF correspond to total emissions  of N2O and removals from activities relating to land use, land-use change and forestry (from the following categories: forest land, cropland, grassland, wetlands, settlements and other land)', '#fb7e21'),
(442, 394, '3035', 'Emissions of SO2 (National Reports, UNFCCC), Including Land Use, Land-Use Change and Forestry', 'Gigagrams CO2 Equivalent', 'Emissions of SO2 with LULUCF correspond to total emissions of SO2 and removals from activities relating to land use, land-use change and forestry (from the following categories: forest land, cropland, grassland, wetlands, settlements and other land)', '#7ba6a6'),
(443, 393, NULL, 'Climate', NULL, 'Precipitation - Cubic Kilometers, Precipitation - Millimeters', NULL),
(444, 443, '1012', 'Precipitation - Cubic Kilometers', 'Cubic Kilometers per Year', 'The CRU Global Climate Dataset available through the IPCC DDC consists of a multi-variate 0.5 latitude by 0.5 longitude resolution mean monthly climatology for global land areas, excluding Antarctica, strictly constrained to the period 1961-1990, together with monthly time series at the same resolution for the period 1901-1995. Precipitation is the annual average (within 1961-90) of water falling on the country.', '#03fb89'),
(445, 443, '1015', 'Precipitation - Millimeters', 'Millimeters per Year', 'The CRU Global Climate Dataset available through the IPCC DDC consists of a multi-variate 0.5 latitude by 0.5 longitude resolution mean monthly climatology for global land areas, excluding Antarctica, strictly constrained to the period 1961-1990, together with monthly time series at the same resolution for the period 1901-1995. Precipitation is the annual average (within 1961-90) of water falling on the country.', '#7a5b81');
